--
-- Table structure for table `applications`
--

CREATE TABLE `applications` (
  `id` int(11) NOT NULL,
  `existing_client` int(1) DEFAULT NULL,
  `client_id` int(11) DEFAULT NULL,
  `referrer_group` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL COMMENT 'Referrer ',
  `application_id` varchar(100) DEFAULT NULL,
  `loan_type` int(1) DEFAULT NULL,
  `type_of_asset` int(2) DEFAULT NULL,
  `loan_amount` float DEFAULT NULL,
  `estimated_property_value` varchar(200) DEFAULT NULL,
  `depreciation` varchar(200) DEFAULT NULL,
  `Interest` float DEFAULT NULL,
  `lender` int(3) DEFAULT NULL,
  `loan_purpose` int(1) DEFAULT NULL,
  `property_funded` int(1) DEFAULT NULL,
  `deal_id` varchar(255) DEFAULT NULL,
  `target_settlement_date` date DEFAULT NULL,
  `date_settled` date DEFAULT NULL,
  `net_profit` float DEFAULT NULL,
  `ammortisation` float DEFAULT NULL,
  `deprecition` float DEFAULT NULL,
  `existing_interest_costs` float DEFAULT NULL,
  `rental_expense` float DEFAULT NULL,
  `proposed_rental_income` float DEFAULT NULL,
  `existing_liabilities` int(1) DEFAULT NULL,
  `additional_property` int(1) DEFAULT NULL,
  `smsf_structure` int(1) DEFAULT NULL,
  `ato_liabilities` int(1) DEFAULT NULL,
  `credit_file_issues` int(1) DEFAULT NULL,
  `application_status` int(1) DEFAULT NULL,
  `application_decision` int(2) DEFAULT NULL,
  `application_completed` int(2) DEFAULT NULL,
  `loan_approval` int(1) DEFAULT NULL COMMENT '1 = Approved, 2 = Declined',
  `mark_as_sent` int(1) DEFAULT NULL,
  `deal_finalised` int(1) DEFAULT NULL,
  `status` int(1) DEFAULT NULL,
  `date_time` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

